(1,'Shangri-Laグループ','conceptbar.info','https://riraku-kan.jp/',5,1,'33335',30,1,1,'<h5>（目的）</h5>\r\n    <h3>第１条 本利用規約は、マジョリカが提供するShangli-raアプリの利用に関し、これを利用するすべての者に適用される利用条件その他の事項を定めることを目的とします。</h3>\r\n    \r\n    <h5>（定義）</h5>\r\n    <h3>第２条　本利用規約で使用する用語の定義は、次の各号のとおりとします。</h3>\r\n\r\n    <h5>（本利用規約への同意）</h5>\r\n    <h3>第３条 アプリ利用者は、本利用規約の定めに従って本アプリを利用しなければならず、本利用規約の内容を十分に理解した上で、本利用規約に同意しない限り、本アプリを利用できません。</h3>\r\n    <p>アプリ利用者は、実際に本アプリの利用を開始した場合には、本利用規約の内容を十分に理解した上で、本利用規約に同意したものとみなされます。</p>\r\n    \r\n    <h5>（本アプリ等に関する知的財産権等）</h5>\r\n    <h3>第４条 Devotionがアプリ利用者に提供する一切のサービス、プログラム及び各種著作物（本利用規約及び利用手順書等を含みます。以下同じ。）に関する著作権及び著作者人格権、商標権その他の知的財産権並びにノウハウその他の知的財産に係る権利は、全てDevotion又は正当な権利者に帰属し、本アプリの利用は、本利用規約で別途定める場合を除き、アプリ利用者に対するこれらの知的財産に係る権利の移転又は使用権の設定若しくは許諾を意味するものではありません。</h3>\r\n    <h4>１ アプリ利用者は、本アプリの利用に際し、Devotionがアプリ利用者に提供する一切のサービス、プログラム及び各種著作物を次の各号のとおり取り扱うものとします。</h4>\r\n    <p>一 本利用規約に従った本アプリの適正な利用のためにのみ使用すること。</p>\r\n    <p>二 複製、改変、編集、頒布等を行わず、また、リバースエンジニアリングを行わないこと。</p>\r\n    <p>三 営利目的の有無にかかわらず、第三者に貸与、譲渡若しくは承継し、又は担保の設定をしないこと。</p>\r\n    <p>四 Devotion又はDevotionが指定する者が表示した著作権表示又は商標権表示を削除又は変更しないこと。</p>\r\n\r\n    <h5>（利用可能時間及び利用の停止等）</h5>\r\n    <h3>第５条 本アプリの利用可能時間は、原則として24時間365日とします。ただし、サーバの運転状況により、本アプリの一部の機能の提供ができない場合があります。</h3>\r\n    <h4>１Devotionは、次の各号のいずれかに該当すると認められる場合は、アプリ利用者に対し、事前にDevotionの公式サイトまたは本アプリ内に掲載した上で、本アプリの利用の停止、休止又は中断をさせることができるものとします。ただし、緊急を要する場合は、事前に通知することなく本アプリの利用の停止、休止又は中断をさせることができるものとします。</h4>\r\n    <p>一 本アプリの運用機器等のメンテナンスが予定される場合</p>\r\n    <p>二 電気通信事業者の役務が提供されない場合</p>\r\n    <p>三 天災、事変その他の非常事態が発生した場合又は本アプリの運用に係る重大な障害が発生した場合</p>\r\n    <p>四 法令又はこれに基づく措置により、本アプリの運用が不可能となった場合</p>\r\n    <p>五 その他、Devotionにおいて、本アプリの利用の停止、休止又は中断が必要と判断した場合</p>\r\n    <h4>２ Devotionは、本アプリの利用が著しく集中した場合には、本アプリの利用を制限することができるものとします。</h4>\r\n    \r\n    <h5>（アプリ利用者のサポート）</h5>\r\n    <h3>第６条 Devotionは、本アプリに関するお問い合わせを受け付けるため、サポートデスクを設置します。サポートデスクは、アプリ利用者からの本アプリに関するお問い合わせ・ご相談をメールで受け付け、回答することにより、本アプリの利用に係るアプリ利用者の支援を行うとともに、本アプリの機能等の改善を図るための情報の集約を行うことを目的とします。メールの受信可能時間は、原則として24時間365日とします。ただし、メールサーバーの運転状況等により、メールの受信ができない場合があります。また、お問い合わせの内容等により、回答までに時間がかかる場合又は回答しかねる場合があります。</h3>\r\n\r\n    <h5>（禁止事項及び遵守事項）</h5>\r\n    <h3>第７条　アプリ利用者は、本アプリの利用に当たり、次の各号に掲げる行為を行うことを禁じます。</h3>\r\n    <p>一 本アプリを本来の目的以外の目的で利用すること。</p>\r\n    <p>二 不正アクセス行為、本アプリのサーバーやネットワークシステムに支障を与える行為、本アプリを不正に操作する行為、本アプリの不具合を意図的に利用する行為をすること。</p>\r\n    <p>三 類似又は同様の問い合わせを必要以上に繰り返す行為、提供者に対し不当な要求をする行為、その他の提供者による本アプリの適正な管理及び運用並びに第三者による本アプリの利用を妨害し、これらに支障を与える行為をすること。</p>\r\n    <p>四 本アプリに対し、ウイルス・マルウェア等に感染したファイルを故意に送信すること。</p>\r\n    <p>五 法令若しくは公序良俗に違反する行為又はそのおそれがある行為、反社会的勢力に対する利益供与その他の協力行為、提供者又は第三者になりすます行為、意図的に虚偽の情報を流布させる行為をすること。</p>\r\n    <p>六 第三者の個人情報、利用情報などを不正に収集、開示又は提供する行為をすること。</p>\r\n    <p>七 その他、本アプリの適正な運用に支障を及ぼす行為又はそのおそれがある行為であるとDevotionが判断する行為をすること。</p>\r\n\r\n    <h4>２ Devotionは、アプリ利用者が前項各号のいずれかに該当する行為を行った場合又は行うおそれがあると認められた場合は、事前に通知することなく、当該アプリ利用者による本アプリの利用を停止させることができるものとします。</h4>\r\n    <h4>３ アプリ利用者は、本アプリの利用に当たり、以下の事項を遵守するものとします。</h4>\r\n    <p>一 複数のスマートフォン端末を保有する場合は、最も利用する端末に本アプリを導入すること。</p>\r\n    <p>二 アプリ導入端末を第三者に持ち歩かせないようにすること。</p>\r\n    <p>三 本アプリが更新され、アプリ利用者においてダウンロードが可能な状態になったときには、アプリ導入端末に最新のアプリケーションをダウンロードして更新すること。</p>\r\n    <p>四 アプリ導入端末を第三者に譲渡、承継若しくは貸与し、又は破棄する場合は、あらかじめ本アプリを削除すること。</p>\r\n    <h5>（アプリ利用者の設備等）</h5>\r\n    <h3>第８条 アプリ利用者は、本アプリを利用するために必要なすべての機器及びソフトウェア（スマートフォン端末及び通信手段に係るすべてのものを含みます。）を自己の負担において準備するものとします。その際、必要な手続は、アプリ利用者が自己の責任で行うものとします。</h3>\r\n    <p>Ⅰ本アプリを利用するために必要な通信費用その他本アプリの利用に係る一切の費用は、アプリ利用者の負担とします。</p>\r\n    <p>３ アプリ利用者が未成年者である場合は、当該アプリ利用者は、親権者その他の法定代理人が本アプリの利用に同意した上で、自らに対してその使用を認めたスマートフォン端末を使用して、本アプリを利用するものとします。</p>\r\n\r\n    <h5>（免責事項）</h5>\r\n    <h3>第９条 Devotionは、本アプリを利用すること（利用に際してウイルス・マルウェア等に感染したことその他理由の如何を問いません。）又は利用できないこと（本アプリの利用の停止、休止、中断若しくは制限、本アプリの動作不良又は通信回線の障害その他理由の如何を問いません。）その他本アプリに起因又は関連してアプリ利用者又は第三者が被った損害について一切の責任を負わないものとします。</h3>\r\n    <h4>２ アプリ導入端末の位置測定は、アプリ導入端末の性能、所持する方向などの条件や状態によって測定値に差が生じるため、本アプリで計測する接触の距離と時間について正確性を保証するものではありません。</h4>\r\n\r\n    <h5>（アプリの利用中止及び記録の削除）</h5>\r\n    <h3>第１０条 アプリ利用者は、いつでも任意に、本アプリをアプリ導入端末から削除することにより、本アプリの利用を中止できます。本アプリをアプリ導入端末から削除した場合は、その端末に記録されていた情報は、全て削除され復元はできません。</h3>\r\n\r\n    <h5>（本利用規約の変更）</h5>\r\n    <h3>第１１条</h3>\r\n    <h4>１Devotionが必要があると認めるときは、アプリ利用者に対し事前に通知を行うことなく、いつでも本利用規約を変更することができるものとします。</h4>\r\n    <h4>２ Devotionは、本利用規約の変更を行った場合には、遅滞なく本アプリ内に掲載するものとし、変更後の本利用規約はかかる掲載がなされた時点からその効力を生ずるものとします。</h4>\r\n    <h4>３ 前項に規定する変更後の本利用規約の掲載後に、アプリ利用者が本アプリを実際に利用した場合には、当該利用の時点で、アプリ利用者は変更後の本利用規約の内容を十分に理解した上で、変更後の本利用規約に同意したものとみなされます。</h4>\r\n\r\n    <h5>（譲渡等禁止）</h5>\r\n    <h3>第１２条 本アプリの利用権は、第三者に譲渡、貸与、承継、相続又は担保として提供することはできません。</h3>\r\n\r\n    <h5>（準拠法及び合意管轄）</h5>\r\n    <h3>第１３条 本利用規約及び本アプリの利用に関連するすべての事項の準拠法は、日本法とします。</h3>\r\n    <h4>２ 本アプリの利用に起因又は関連してDevotionとアプリ利用者との間に生じたすべての紛争については、名古屋地方裁判所を第一審の専属的合意管轄裁判所とします。</h4>\r\n\r\nプライバシーポリシー\r\n\r\n▲●株式会社（以下「当社」という）は、当社の提供する【アプリ名】の利用者（以下「ユーザー」という）に関する個人情報を含んだ情報（以下「ユーザー情報」という）の取扱いについて、以下のとおりプライバシーポリシー（以下「本ポリシー」という）を定めます。\r\n\r\n１．情報を取得するアプリ提供者\r\n▲●株式会社\r\n\r\n２．取得するユーザー情報と目的\r\n本アプリケーションで取得するユーザー情報と目的は以下のとおりです。\r\n取得するユーザー情報	利用目的\r\n端末に関する情報	・デバイスの種類、モデル、メーカー\r\n・OS\r\n・キャリア情報\r\n・IPアドレス\r\n・IDFA、AAID、GAID	・ユーザーに最適化された広告の提供\r\n・位置情報に基づく広告の提供\r\n・パフォーマンス分析\r\n・アプリケーションの改善\r\n・ユーザーへのサポート\r\n\r\n		\r\n位置情報	・GPSに基づいた緯度、経度\r\n・Wi-Fiアクセスポイントの緯度、経度	\r\n		\r\n広告に関する情報	・表示場所\r\n・クリックの有無\r\n・閲覧回数\r\n・広告の製品またはサービスの利用状況	\r\n\r\n３．取得方法\r\n当社は、情報収集モジュールを内蔵した本アプリケーションにより、ユーザー情報を自動取得します。\r\n\r\n４．通知・公表または同意取得の方法・利用者関与の方法\r\n（１）通知・公表\r\n当社は、本ポリシーおよび▲●株式会社プライバシーポリシーに関する通知・公表は本アプリケーションまたは当社のホームページに掲載する方法で行います。\r\n\r\n（２）同意取得の方法\r\n同意の取得は、本アプリケーションの初回起動時に取得する方法で行います。\r\n\r\n（３）利用者関与の方法\r\nユーザー情報の取得は、本アプリケーションをアンインストールすることで中止することができます。\r\n\r\n５．外部送信・第三者提供・情報収集モジュール\r\n（１）外部送信\r\n取得したユーザー情報については、当社が管理を委託するホスティング会社のサーバーに送信されます。\r\n\r\n（２）第三者提供\r\n当社は、取得したユーザー情報について、以下の場合第三者に提供することがあります。\r\n・統計的なデータなどユーザーを識別することができない状態で提供する場合\r\n・法令に基づき開示・提供を求められた場合\r\n\r\n\r\n６．お問い合わせ\r\n当社のプライバシーポリシーに関する、ご意見、ご質問、苦情の申出その他ユーザー情報の取扱いに関するお問い合わせは、以下の窓口にご連絡ください。\r\n\r\nマジョリカ代表　粕谷洸太\r\n\r\n７．改定\r\n当社は、当社の裁量に基づいて、本ポリシーを変更します。但し、取得するユーザー情報、利用目的、第三者提供に変更が発生した場合、本アプリケーションまたは当社のホームページで通知するとともに、本ポリシー変更後、本アプリケーションの初回起動時に改めてユーザーから同意を取得します。\r\n\r\n８．マジョリカプライバシーポリシー\r\n本ポリシーに定めのない事項については、下記URLの内容が適用されます。\r\n\r\nhttps://conceptbar.info/old_recruit/law.html\r\n\r\n９．制定日・改定日\r\n制定：2022年9月1日\r\n\r\n',1,15,'sandbox-sq0idb-aepJTYabn-IcYlUoP76mNg','LNJJGFH22820Z','','2021-08-22 08:51:01','2023-03-06 15:29:00'),
(2,'株式会社アスクリエイトりらくーかん','riraku-kan.jp',NULL,5,1,'58585',2,1,1,'<p>会員は、以下に定める利用規約の各条項に従い、株式会社アスクリエイトが運営するアプリ（以下「本アプリ」）でアカウントおよびパスワードの登録を行うことにより、本アプリにおいて提供するサービスをご利用いただくことが出来ます。<br><br>お客様がアプリ上より登録情報を発信された時点で、以下に定めるアプリ利用規約に同意していただくものといたします。</p>\r\n\r\n<p><strong>第1条【利用規約】</strong></p>\r\n\r\n<p>「株式会社アスクリエイト」（以下「弊社」）が運営する、アプリ（以下「本サイト」）において提供するサービスを、ご利用いただく際の規約を「利用規約」（以下「本規約」）として、会員登録したお客様が利用する際の全てに適用いたします。</p>\r\n\r\n<p><strong>第2条【定義】</strong></p>\r\n\r\n<p>本規約における用語の定義は、別途定めるものを除き、以下の通りとします。</p>\r\n\r\n<p>1、「本アプリ」とは、弊社が運営するアプリをいい、施術予約・指名予約・電子回数券の販売・物品の販売等におけるサービス、及び弊社が運営する店舗やサービスに関する情報、その他今後弊社が提供する、会員様向けの各種サービスをいいます。</p>\r\n\r\n<p>2、「会員」とは、本規約に同意の上、所定の手続きにより本アプリで会員登録をしていただいた方（個人）をいいます。</p>\r\n\r\n<p>3、「会員情報」とは、お客様が弊社に開示したお客様ご本人に関する情報及びお客様の取引に関する履歴等の情報をいいます。</p>\r\n\r\n<p><strong>第3条【規約の適用】</strong></p>\r\n\r\n<p>1、本規約は、本アプリをご利用いただく会員に適用されるものとし、また本アプリの利用規定および本アプリが表示する諸注意に従うものとします。</p>\r\n\r\n<p>2、弊社は本規約の内容を利用者の了承を得ることなく、その判断により適宜変更・改定できるものとします。また、本規約が変更された場合、会員は変更後の規約に従うものとします。</p>\r\n\r\n<p>3、変更後の利用規約は、弊社が別途定める場合をのぞいて、アプリ上に表示した時点より効力を生じるものとします。</p>\r\n\r\n<p><strong>第4条【会員登録】</strong></p>\r\n\r\n<p>1、会員登録を希望されるお客様は、本アプリの会員登録ページから弊社の指定する方法に従い、会員登録手続きを行うものとします。</p>\r\n\r\n<p>2、会員登録手続きは、登録をされるご本人（個人）が行うものとします。また、会員登録において、登録されるご本人の正しい情報のみを登録できるものとし、一部または全部を問わず、虚偽の情報、第三者の情報、存在しない情報の登録はその一切を認めないものとします。</p>\r\n\r\n<p>3、会員登録は、弊社が前項の会員登録手続きを受付け、会員登録希望者に対し「登録完了のお知らせメール」を発信したときに完了するものとし、 弊社が定める条件に従って、本アプリにてサービスをご利用いただけるものとします。ただし、過去に本規約違反をしたことなどにより、弊社から会員登録の抹消処分を受けている場合や会員登録申請内容に虚偽の事項が含まれている場合、第9条に規定する事項に該当する場合、その他弊社においてふさわしくないと判断される場合には、会員登録希望者の会員登録を承認しない場合があります。</p>\r\n\r\n<p>4、会員を取得された利用者は、登録された会員情報の内容に変更があった場合には、弊社が指示する方法により、速やかに会員情報変更の手続きを行うものとします。変更をされないことにより、会員が不利益を被ったとしても、弊社は一切その責任を負いません。</p>\r\n\r\n<p>5、会員を取得された会員は、弊社に登録された会員情報の内容に虚偽がないことを保証するものとします。</p>\r\n\r\n<p>6、会員登録時に設定していただいたパスワードにつきましては、会員ご自身で管理し、お忘れの場合は、会員として登録していただいているメールアドレスに、パスワード再設定用のＵＲＬをお送りいたしますので、会員が、ご自身で再設定してください。<br>なお、アカウント・パスワードをお忘れの場合で、再度アカウント登録をしていただいた場合には、それまでのお取引履歴等は継続されません。</p>\r\n\r\n<p><strong>第5条【会員個人情報の取り扱い】</strong></p>\r\n\r\n<p>弊社は、会員の個人情報を、別途定めるプライバシーポリシーに従い利用・管理するものとします。</p>\r\n\r\n<p><strong>第6条【会員登録情報の管理（アカウント・パスワードなど）】</strong></p>\r\n\r\n<p>1、アカウントを取得された会員は、会員ご本人の情報に変更が生じた場合には、すみやかに情報の変更登録をおこなうものとします。</p>\r\n\r\n<p>2、会員は、利用者自身の設定したメール・アドレスおよびパスワードにつき、自己の責任において、管理・保管を行うものとします。</p>\r\n\r\n<p>3、会員はアカウントおよびパスワードを第三者(他の会員を含む) に利用させてはならず、また売買、贈与、貸与、名義変更、その他の譲渡をしてはならないものとします。</p>\r\n\r\n<p>4、会員は、自己のアカウント及びこれに対応するパスワードの使用及び管理について一切の責任を持つものとし、自己のアカウント及びパスワードによってなされた一切の行員及びその結果について、当該行為を自己がしたか否かを問わず、責任を負うものとします。</p>\r\n\r\n<p>5、会員は、アカウントおよびパスワードにつき盗難・紛失した場合、または第三者(弊社の他のお客様を含む) により使用されていることが判明した場合には、直ちに弊社に連絡するとともに弊社からの指示に従うものとします。</p>\r\n\r\n<p>6、会員は、パスワードの変更、会員登録の取り消し等を希望する場合には、本アプリが定める手順に従い手続きをおこなうものとします。</p>\r\n\r\n<p><strong>第7条【退会】</strong></p>\r\n\r\n<p>会員が、退会を希望する場合には、アカウントを所持しているご本人が本アプリのプロフィールより退会の手続きをおこなうものとします。退会手続き完了後に退会となり、それ以前に提供されていたサービスおよび権利は一切無効となるものとします。なお、退会した利用者が再度アカウント登録を行ったとしても、前回の履歴、権利などを引き継ぐことはできないものとします。</p>\r\n\r\n<p><strong>第8条【禁止事項】</strong></p>\r\n\r\n<p>会員は弊社サイト利用にあたり、以下の行為を行ってはならないものとします。また、会員がこの条項に違反し、弊社が損害を被った場合には、会員は、損害賠償の責任を負うものとします。</p>\r\n\r\n<p>1、法令、本規約、本サイトの通販規約および本サイトが表示する諸注意に違反する行為、又はそのおそれがある行為。</p>\r\n\r\n<p>2、第三者からの許可の有無を問わず、第三者のアカウント、メールアドレスおよびパスワードを使用する行為、又はそのおそれがある行為。</p>\r\n\r\n<p>3、ご利用の際に虚偽の登録内容を申請する行為</p>\r\n\r\n<p>4、本サービスに支障をきたすおそれのある行為</p>\r\n\r\n<p>5、第三者もしくは弊社に迷惑、不利益もしくは損害を与える行為、又はそのおそれがある行為。</p>\r\n\r\n<p>6、その他、公序良俗違反、不正、妨害、虚偽、有害等に該当する事項および弊社が不適当と判断する行為。</p>\r\n\r\n<p><strong>第9条【会員の取消】</strong></p>\r\n\r\n<p>弊社は、次の各号に該当した場合には会員の事前の承認を得ることなく、直ちに会員を取り消すことができるものとします。</p>\r\n\r\n<p>会員の取り消しがあった場合は、それ以前に提供されていたサービスおよび権利は一切無効となるものとします。また、会員の取り消しがあった場合には、それ以降再度のアカウント登録は受け付けないものとします。</p>\r\n\r\n<p>1、本規約第8条【禁止事項】の各号に該当する行為があった場合</p>\r\n\r\n<p>2、その他弊社が会員登録をしていただくにあたり、不適当と認める事項がある場合</p>\r\n\r\n<p>3、その他、本規約に違反した場合</p>\r\n\r\n<p>4、会員情報のセキュリティを確保するために必要な場合</p>\r\n\r\n<p>5、手段の如何を問わず、弊社または本サービスの運営を妨害した場合</p>\r\n\r\n<p>6、過去に本規約違反等の理由により会員を抹消されていることが判明した場合</p>\r\n\r\n<p><strong>第10条【免責事項】</strong></p>\r\n\r\n<p>1、会員は、自己のリスク負担において、サービスを利用するものとします。</p>\r\n\r\n<p>2、弊社は、サービスの安全性、完全性、正確性、適用性、有用性などにつき、いかなる責任も負わないものとします。また、以下の各号についても同様とします。</p>\r\n\r\n<p>（1）通信回線やコンピュータなどの障害によるシステムの中断・遅滞・中止・データの消失、データの不正アクセスにより生じた損害、その他弊社のサービスに関して利用者に生じた損害<br>（2）弊社のウェブページ・サーバ・ドメインなどから送られるメール・コンテンツに、コンピュータ・ウィルスなどの有害なものが含まれていた場合の損害<br>（3）会員が法令、本規約、本アプリの利用規約および本アプリで表示する諸注意に違反したことによって生じた損害<br>（4）会員が、サービスの利用を通じて第三者に与えた損害</p>\r\n\r\n<p><strong>第11条【サービスの変更・廃止】</strong></p>\r\n\r\n<p>弊社は、その判断によりサービスの全部・または一部を適宜変更・廃止できるものとします。</p>\r\n\r\n<p><strong>第12条【準拠法】</strong></p>\r\n\r\n<p>本規約に関する準拠法は、日本法とします。</p>\r\n\r\n<p><strong>第13条【紛争の解決、管轄裁判所】</strong></p>\r\n\r\n<p>1、サービスの利用に関し、本規約により解決できない紛争および問題が生じた場合には、会員と弊社は、双方誠意をもって話し合い、これを解決するものとします。</p>\r\n\r\n<p>2、本規約に関して訴訟の必要が生じた場合には、名古屋地方裁判所を第一審の専属的合意管轄裁判所とします。</p>\r\n\r\n<p></p>\r\n\r\n<p><strong><span class=\"fz-16px\"><span class=\"fz-18px\"><span class=\"fz-22px\">プライバシーポリシー</span></span></span></strong></p>\r\n\r\n<p>株式会社アスクリエイト（以下、弊社といいます）では、個人情報の保護に関する法令を遵守するとともに、 以下のポリシーに基づき、お客様の個人情報を取り扱います。</p>\r\n\r\n<p><strong>1.</strong><strong>個人情報とは？</strong><strong></strong></p>\r\n\r\n<p>個人に関する情報で、氏名、住所、電話番号、メールアドレス、購入履歴など個人を特定できる情報、またはその可能性のある情報の事です。また、他の情報との組み合わせによって個人が特定できる情報も含みます（業種等）。</p>\r\n\r\n<p><strong>2.</strong><strong>個人情報の収集について</strong><strong></strong></p>\r\n\r\n<p>通常、アプリ（以下、本サイトといいます）を利用する場合、会員登録（氏名、電話番号、メールアドレス、生年月日等）の入力をお願いしております。それらの情報の利用目的につきましては、「3.個人情報の利用目的について」を、管理につきましては、「4.個人情報の管理について」をご参照下さい。</p>\r\n\r\n<p><strong>3.</strong><strong>個人情報の利用目的について</strong><strong></strong></p>\r\n\r\n<p>当社は個人情報を以下の目的で利用させていただきます。 　<br>a.施術予約に関する時間、コース、指名の確認メッセージ、また、代金のお支払いに関連してご指定いただいたクレジットカード番号などのお支払情報等。 　b.当社が行うキャンペーンや商品、サービスのご案内。 　d.お客さまから寄せられたメッセージやアンケートの結果、ご利用履歴等。 　e.次回の会員ログインが容易に行えるよう、ログイン情報の保持の為。f.その他サイト運営上必要な場合に利用。</p>\r\n<p><strong>4.</strong><strong>個人情報の管理について</strong><strong></strong></p>\r\n<p>当社は以下の体制で個人情報を管理します。 a.個人情報の利用を業務上必要な者だけに制限し、個人情報が含まれる内容の管理を徹底致します。 但し、お客様へ商品やサービスを提供する等の業務遂行上、個人情報の一部を外部の委託先へ提供する場合があります。その場合、業務委託先が適切に個人情報を取り扱うように管理いたします。 b.不要になった個人情報は、随時削除していきます。</p>\r\n\r\n<p><strong>5.</strong><strong>個人情報の開示について</strong><strong></strong></p>\r\n\r\n<p>当社は、お客様の同意がない限り、個人情報を第三者に開示することはありません。ただし、以下の事例に該当する場合はその限りではありません。 　a.官庁、裁判所、検察官、警察、弁護士会、消費者センター、またはそれらに準じる権限を有する機関から要請があった場合。 　b.法令に特別の規定がある場合。 　c.法令や当社のご利用規約・注意事項に反する行動から、当社の権利、財産またはサービスを保護または防禦する必要があり、本人の同意を得ることができない場合。</p>\r\n\r\n<p><strong>6.</strong><strong>適用範囲</strong><strong></strong></p>\r\n\r\n<p>以上のプライバシーポリシーに関する適用範囲は、本アプリ内において適用されます。</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n',1,15,'sandbox-sq0idb-stLFXTaZyTH37G_-96BMFA','LPYTH0Q1Q5392','EAAAEKIA22FHeHHFFFw9NHYw_N7UiW83_IS7hXSErVp6XO2Yg7S8z4vVPgAMuaxj','2021-08-23 10:40:25','2022-03-25 12:37:02'),
(3,'株式会社アスクリエイトコリとりステーション＆手温','koritori.jp',NULL,5,1,'',NULL,1,1,'<h5>（目的）</h5>\r\n    <h3>第１条 本利用規約は、Devotionが提供するクラウドPOSアプリケーション「VISIT」(以下、本アプリ)の利用に関し、これを利用するすべての者に適用される利用条件その他の事項を定めることを目的とします。</h3>\r\n    \r\n    <h5>（定義）</h5>\r\n    <h3>第２条　本利用規約で使用する用語の定義は、次の各号のとおりとします。</h3>\r\n\r\n    <h5>（本利用規約への同意）</h5>\r\n    <h3>第３条 アプリ利用者は、本利用規約の定めに従って本アプリを利用しなければならず、本利用規約の内容を十分に理解した上で、本利用規約に同意しない限り、本アプリを利用できません。</h3>\r\n    <p>アプリ利用者は、実際に本アプリの利用を開始した場合には、本利用規約の内容を十分に理解した上で、本利用規約に同意したものとみなされます。</p>\r\n    \r\n    <h5>（本アプリ等に関する知的財産権等）</h5>\r\n    <h3>第４条 Devotionがアプリ利用者に提供する一切のサービス、プログラム及び各種著作物（本利用規約及び利用手順書等を含みます。以下同じ。）に関する著作権及び著作者人格権、商標権その他の知的財産権並びにノウハウその他の知的財産に係る権利は、全てDevotion又は正当な権利者に帰属し、本アプリの利用は、本利用規約で別途定める場合を除き、アプリ利用者に対するこれらの知的財産に係る権利の移転又は使用権の設定若しくは許諾を意味するものではありません。</h3>\r\n    <h4>１ アプリ利用者は、本アプリの利用に際し、Devotionがアプリ利用者に提供する一切のサービス、プログラム及び各種著作物を次の各号のとおり取り扱うものとします。</h4>\r\n    <p>一 本利用規約に従った本アプリの適正な利用のためにのみ使用すること。</p>\r\n    <p>二 複製、改変、編集、頒布等を行わず、また、リバースエンジニアリングを行わないこと。</p>\r\n    <p>三 営利目的の有無にかかわらず、第三者に貸与、譲渡若しくは承継し、又は担保の設定をしないこと。</p>\r\n    <p>四 Devotion又はDevotionが指定する者が表示した著作権表示又は商標権表示を削除又は変更しないこと。</p>\r\n\r\n    <h5>（利用可能時間及び利用の停止等）</h5>\r\n    <h3>第５条 本アプリの利用可能時間は、原則として24時間365日とします。ただし、サーバの運転状況により、本アプリの一部の機能の提供ができない場合があります。</h3>\r\n    <h4>１Devotionは、次の各号のいずれかに該当すると認められる場合は、アプリ利用者に対し、事前にDevotionの公式サイトまたは本アプリ内に掲載した上で、本アプリの利用の停止、休止又は中断をさせることができるものとします。ただし、緊急を要する場合は、事前に通知することなく本アプリの利用の停止、休止又は中断をさせることができるものとします。</h4>\r\n    <p>一 本アプリの運用機器等のメンテナンスが予定される場合</p>\r\n    <p>二 電気通信事業者の役務が提供されない場合</p>\r\n    <p>三 天災、事変その他の非常事態が発生した場合又は本アプリの運用に係る重大な障害が発生した場合</p>\r\n    <p>四 法令又はこれに基づく措置により、本アプリの運用が不可能となった場合</p>\r\n    <p>五 その他、Devotionにおいて、本アプリの利用の停止、休止又は中断が必要と判断した場合</p>\r\n    <h4>２ Devotionは、本アプリの利用が著しく集中した場合には、本アプリの利用を制限することができるものとします。</h4>\r\n    \r\n    <h5>（アプリ利用者のサポート）</h5>\r\n    <h3>第６条 Devotionは、本アプリに関するお問い合わせを受け付けるため、サポートデスクを設置します。サポートデスクは、アプリ利用者からの本アプリに関するお問い合わせ・ご相談をメールで受け付け、回答することにより、本アプリの利用に係るアプリ利用者の支援を行うとともに、本アプリの機能等の改善を図るための情報の集約を行うことを目的とします。メールの受信可能時間は、原則として24時間365日とします。ただし、メールサーバーの運転状況等により、メールの受信ができない場合があります。また、お問い合わせの内容等により、回答までに時間がかかる場合又は回答しかねる場合があります。</h3>\r\n\r\n    <h5>（禁止事項及び遵守事項）</h5>\r\n    <h3>第７条　アプリ利用者は、本アプリの利用に当たり、次の各号に掲げる行為を行うことを禁じます。</h3>\r\n    <p>一 本アプリを本来の目的以外の目的で利用すること。</p>\r\n    <p>二 不正アクセス行為、本アプリのサーバーやネットワークシステムに支障を与える行為、本アプリを不正に操作する行為、本アプリの不具合を意図的に利用する行為をすること。</p>\r\n    <p>三 類似又は同様の問い合わせを必要以上に繰り返す行為、提供者に対し不当な要求をする行為、その他の提供者による本アプリの適正な管理及び運用並びに第三者による本アプリの利用を妨害し、これらに支障を与える行為をすること。</p>\r\n    <p>四 本アプリに対し、ウイルス・マルウェア等に感染したファイルを故意に送信すること。</p>\r\n    <p>五 法令若しくは公序良俗に違反する行為又はそのおそれがある行為、反社会的勢力に対する利益供与その他の協力行為、提供者又は第三者になりすます行為、意図的に虚偽の情報を流布させる行為をすること。</p>\r\n    <p>六 第三者の個人情報、利用情報などを不正に収集、開示又は提供する行為をすること。</p>\r\n    <p>七 その他、本アプリの適正な運用に支障を及ぼす行為又はそのおそれがある行為であるとDevotionが判断する行為をすること。</p>\r\n\r\n    <h4>２ Devotionは、アプリ利用者が前項各号のいずれかに該当する行為を行った場合又は行うおそれがあると認められた場合は、事前に通知することなく、当該アプリ利用者による本アプリの利用を停止させることができるものとします。</h4>\r\n    <h4>３ アプリ利用者は、本アプリの利用に当たり、以下の事項を遵守するものとします。</h4>\r\n    <p>一 複数のスマートフォン端末を保有する場合は、最も利用する端末に本アプリを導入すること。</p>\r\n    <p>二 アプリ導入端末を第三者に持ち歩かせないようにすること。</p>\r\n    <p>三 本アプリが更新され、アプリ利用者においてダウンロードが可能な状態になったときには、アプリ導入端末に最新のアプリケーションをダウンロードして更新すること。</p>\r\n    <p>四 アプリ導入端末を第三者に譲渡、承継若しくは貸与し、又は破棄する場合は、あらかじめ本アプリを削除すること。</p>\r\n    <h5>（アプリ利用者の設備等）</h5>\r\n    <h3>第８条 アプリ利用者は、本アプリを利用するために必要なすべての機器及びソフトウェア（スマートフォン端末及び通信手段に係るすべてのものを含みます。）を自己の負担において準備するものとします。その際、必要な手続は、アプリ利用者が自己の責任で行うものとします。</h3>\r\n    <p>Ⅰ本アプリを利用するために必要な通信費用その他本アプリの利用に係る一切の費用は、アプリ利用者の負担とします。</p>\r\n    <p>３ アプリ利用者が未成年者である場合は、当該アプリ利用者は、親権者その他の法定代理人が本アプリの利用に同意した上で、自らに対してその使用を認めたスマートフォン端末を使用して、本アプリを利用するものとします。</p>\r\n\r\n    <h5>（免責事項）</h5>\r\n    <h3>第９条 Devotionは、本アプリを利用すること（利用に際してウイルス・マルウェア等に感染したことその他理由の如何を問いません。）又は利用できないこと（本アプリの利用の停止、休止、中断若しくは制限、本アプリの動作不良又は通信回線の障害その他理由の如何を問いません。）その他本アプリに起因又は関連してアプリ利用者又は第三者が被った損害について一切の責任を負わないものとします。</h3>\r\n    <h4>２ アプリ導入端末の位置測定は、アプリ導入端末の性能、所持する方向などの条件や状態によって測定値に差が生じるため、本アプリで計測する接触の距離と時間について正確性を保証するものではありません。</h4>\r\n\r\n    <h5>（アプリの利用中止及び記録の削除）</h5>\r\n    <h3>第１０条 アプリ利用者は、いつでも任意に、本アプリをアプリ導入端末から削除することにより、本アプリの利用を中止できます。本アプリをアプリ導入端末から削除した場合は、その端末に記録されていた情報は、全て削除され復元はできません。</h3>\r\n\r\n    <h5>（本利用規約の変更）</h5>\r\n    <h3>第１１条</h3>\r\n    <h4>１Devotionが必要があると認めるときは、アプリ利用者に対し事前に通知を行うことなく、いつでも本利用規約を変更することができるものとします。</h4>\r\n    <h4>２ Devotionは、本利用規約の変更を行った場合には、遅滞なく本アプリ内に掲載するものとし、変更後の本利用規約はかかる掲載がなされた時点からその効力を生ずるものとします。</h4>\r\n    <h4>３ 前項に規定する変更後の本利用規約の掲載後に、アプリ利用者が本アプリを実際に利用した場合には、当該利用の時点で、アプリ利用者は変更後の本利用規約の内容を十分に理解した上で、変更後の本利用規約に同意したものとみなされます。</h4>\r\n\r\n    <h5>（譲渡等禁止）</h5>\r\n    <h3>第１２条 本アプリの利用権は、第三者に譲渡、貸与、承継、相続又は担保として提供することはできません。</h3>\r\n\r\n    <h5>（準拠法及び合意管轄）</h5>\r\n    <h3>第１３条 本利用規約及び本アプリの利用に関連するすべての事項の準拠法は、日本法とします。</h3>\r\n    <h4>２ 本アプリの利用に起因又は関連してDevotionとアプリ利用者との間に生じたすべての紛争については、名古屋地方裁判所を第一審の専属的合意管轄裁判所とします。</h4>',1,15,NULL,NULL,'','2021-08-23 10:41:37','2022-02-26 14:48:26'),
(4,'Libero Entertainment ','libero-school.com',NULL,5,1,'',NULL,1,0,'<h5>（目的）</h5>\r\n    <h3>第１条 本利用規約は、Devotionが提供するクラウドPOSアプリケーション「VISIT」(以下、本アプリ)の利用に関し、これを利用するすべての者に適用される利用条件その他の事項を定めることを目的とします。</h3>\r\n    \r\n    <h5>（定義）</h5>\r\n    <h3>第２条　本利用規約で使用する用語の定義は、次の各号のとおりとします。</h3>\r\n\r\n    <h5>（本利用規約への同意）</h5>\r\n    <h3>第３条 アプリ利用者は、本利用規約の定めに従って本アプリを利用しなければならず、本利用規約の内容を十分に理解した上で、本利用規約に同意しない限り、本アプリを利用できません。</h3>\r\n    <p>アプリ利用者は、実際に本アプリの利用を開始した場合には、本利用規約の内容を十分に理解した上で、本利用規約に同意したものとみなされます。</p>\r\n    \r\n    <h5>（本アプリ等に関する知的財産権等）</h5>\r\n    <h3>第４条 Devotionがアプリ利用者に提供する一切のサービス、プログラム及び各種著作物（本利用規約及び利用手順書等を含みます。以下同じ。）に関する著作権及び著作者人格権、商標権その他の知的財産権並びにノウハウその他の知的財産に係る権利は、全てDevotion又は正当な権利者に帰属し、本アプリの利用は、本利用規約で別途定める場合を除き、アプリ利用者に対するこれらの知的財産に係る権利の移転又は使用権の設定若しくは許諾を意味するものではありません。</h3>\r\n    <h4>１ アプリ利用者は、本アプリの利用に際し、Devotionがアプリ利用者に提供する一切のサービス、プログラム及び各種著作物を次の各号のとおり取り扱うものとします。</h4>\r\n    <p>一 本利用規約に従った本アプリの適正な利用のためにのみ使用すること。</p>\r\n    <p>二 複製、改変、編集、頒布等を行わず、また、リバースエンジニアリングを行わないこと。</p>\r\n    <p>三 営利目的の有無にかかわらず、第三者に貸与、譲渡若しくは承継し、又は担保の設定をしないこと。</p>\r\n    <p>四 Devotion又はDevotionが指定する者が表示した著作権表示又は商標権表示を削除又は変更しないこと。</p>\r\n\r\n    <h5>（利用可能時間及び利用の停止等）</h5>\r\n    <h3>第５条 本アプリの利用可能時間は、原則として24時間365日とします。ただし、サーバの運転状況により、本アプリの一部の機能の提供ができない場合があります。</h3>\r\n    <h4>１Devotionは、次の各号のいずれかに該当すると認められる場合は、アプリ利用者に対し、事前にDevotionの公式サイトまたは本アプリ内に掲載した上で、本アプリの利用の停止、休止又は中断をさせることができるものとします。ただし、緊急を要する場合は、事前に通知することなく本アプリの利用の停止、休止又は中断をさせることができるものとします。</h4>\r\n    <p>一 本アプリの運用機器等のメンテナンスが予定される場合</p>\r\n    <p>二 電気通信事業者の役務が提供されない場合</p>\r\n    <p>三 天災、事変その他の非常事態が発生した場合又は本アプリの運用に係る重大な障害が発生した場合</p>\r\n    <p>四 法令又はこれに基づく措置により、本アプリの運用が不可能となった場合</p>\r\n    <p>五 その他、Devotionにおいて、本アプリの利用の停止、休止又は中断が必要と判断した場合</p>\r\n    <h4>２ Devotionは、本アプリの利用が著しく集中した場合には、本アプリの利用を制限することができるものとします。</h4>\r\n    \r\n    <h5>（アプリ利用者のサポート）</h5>\r\n    <h3>第６条 Devotionは、本アプリに関するお問い合わせを受け付けるため、サポートデスクを設置します。サポートデスクは、アプリ利用者からの本アプリに関するお問い合わせ・ご相談をメールで受け付け、回答することにより、本アプリの利用に係るアプリ利用者の支援を行うとともに、本アプリの機能等の改善を図るための情報の集約を行うことを目的とします。メールの受信可能時間は、原則として24時間365日とします。ただし、メールサーバーの運転状況等により、メールの受信ができない場合があります。また、お問い合わせの内容等により、回答までに時間がかかる場合又は回答しかねる場合があります。</h3>\r\n\r\n    <h5>（禁止事項及び遵守事項）</h5>\r\n    <h3>第７条　アプリ利用者は、本アプリの利用に当たり、次の各号に掲げる行為を行うことを禁じます。</h3>\r\n    <p>一 本アプリを本来の目的以外の目的で利用すること。</p>\r\n    <p>二 不正アクセス行為、本アプリのサーバーやネットワークシステムに支障を与える行為、本アプリを不正に操作する行為、本アプリの不具合を意図的に利用する行為をすること。</p>\r\n    <p>三 類似又は同様の問い合わせを必要以上に繰り返す行為、提供者に対し不当な要求をする行為、その他の提供者による本アプリの適正な管理及び運用並びに第三者による本アプリの利用を妨害し、これらに支障を与える行為をすること。</p>\r\n    <p>四 本アプリに対し、ウイルス・マルウェア等に感染したファイルを故意に送信すること。</p>\r\n    <p>五 法令若しくは公序良俗に違反する行為又はそのおそれがある行為、反社会的勢力に対する利益供与その他の協力行為、提供者又は第三者になりすます行為、意図的に虚偽の情報を流布させる行為をすること。</p>\r\n    <p>六 第三者の個人情報、利用情報などを不正に収集、開示又は提供する行為をすること。</p>\r\n    <p>七 その他、本アプリの適正な運用に支障を及ぼす行為又はそのおそれがある行為であるとDevotionが判断する行為をすること。</p>\r\n\r\n    <h4>２ Devotionは、アプリ利用者が前項各号のいずれかに該当する行為を行った場合又は行うおそれがあると認められた場合は、事前に通知することなく、当該アプリ利用者による本アプリの利用を停止させることができるものとします。</h4>\r\n    <h4>３ アプリ利用者は、本アプリの利用に当たり、以下の事項を遵守するものとします。</h4>\r\n    <p>一 複数のスマートフォン端末を保有する場合は、最も利用する端末に本アプリを導入すること。</p>\r\n    <p>二 アプリ導入端末を第三者に持ち歩かせないようにすること。</p>\r\n    <p>三 本アプリが更新され、アプリ利用者においてダウンロードが可能な状態になったときには、アプリ導入端末に最新のアプリケーションをダウンロードして更新すること。</p>\r\n    <p>四 アプリ導入端末を第三者に譲渡、承継若しくは貸与し、又は破棄する場合は、あらかじめ本アプリを削除すること。</p>\r\n    <h5>（アプリ利用者の設備等）</h5>\r\n    <h3>第８条 アプリ利用者は、本アプリを利用するために必要なすべての機器及びソフトウェア（スマートフォン端末及び通信手段に係るすべてのものを含みます。）を自己の負担において準備するものとします。その際、必要な手続は、アプリ利用者が自己の責任で行うものとします。</h3>\r\n    <p>Ⅰ本アプリを利用するために必要な通信費用その他本アプリの利用に係る一切の費用は、アプリ利用者の負担とします。</p>\r\n    <p>３ アプリ利用者が未成年者である場合は、当該アプリ利用者は、親権者その他の法定代理人が本アプリの利用に同意した上で、自らに対してその使用を認めたスマートフォン端末を使用して、本アプリを利用するものとします。</p>\r\n\r\n    <h5>（免責事項）</h5>\r\n    <h3>第９条 Devotionは、本アプリを利用すること（利用に際してウイルス・マルウェア等に感染したことその他理由の如何を問いません。）又は利用できないこと（本アプリの利用の停止、休止、中断若しくは制限、本アプリの動作不良又は通信回線の障害その他理由の如何を問いません。）その他本アプリに起因又は関連してアプリ利用者又は第三者が被った損害について一切の責任を負わないものとします。</h3>\r\n    <h4>２ アプリ導入端末の位置測定は、アプリ導入端末の性能、所持する方向などの条件や状態によって測定値に差が生じるため、本アプリで計測する接触の距離と時間について正確性を保証するものではありません。</h4>\r\n\r\n    <h5>（アプリの利用中止及び記録の削除）</h5>\r\n    <h3>第１０条 アプリ利用者は、いつでも任意に、本アプリをアプリ導入端末から削除することにより、本アプリの利用を中止できます。本アプリをアプリ導入端末から削除した場合は、その端末に記録されていた情報は、全て削除され復元はできません。</h3>\r\n\r\n    <h5>（本利用規約の変更）</h5>\r\n    <h3>第１１条</h3>\r\n    <h4>１Devotionが必要があると認めるときは、アプリ利用者に対し事前に通知を行うことなく、いつでも本利用規約を変更することができるものとします。</h4>\r\n    <h4>２ Devotionは、本利用規約の変更を行った場合には、遅滞なく本アプリ内に掲載するものとし、変更後の本利用規約はかかる掲載がなされた時点からその効力を生ずるものとします。</h4>\r\n    <h4>３ 前項に規定する変更後の本利用規約の掲載後に、アプリ利用者が本アプリを実際に利用した場合には、当該利用の時点で、アプリ利用者は変更後の本利用規約の内容を十分に理解した上で、変更後の本利用規約に同意したものとみなされます。</h4>\r\n\r\n    <h5>（譲渡等禁止）</h5>\r\n    <h3>第１２条 本アプリの利用権は、第三者に譲渡、貸与、承継、相続又は担保として提供することはできません。</h3>\r\n\r\n    <h5>（準拠法及び合意管轄）</h5>\r\n    <h3>第１３条 本利用規約及び本アプリの利用に関連するすべての事項の準拠法は、日本法とします。</h3>\r\n    <h4>２ 本アプリの利用に起因又は関連してDevotionとアプリ利用者との間に生じたすべての紛争については、名古屋地方裁判所を第一審の専属的合意管轄裁判所とします。</h4>',1,15,'sandbox-sq0idb-CdG8-HaCsNN_VRA14OfYOA','L6JQJ7XDM466Q','','2021-08-23 10:42:19','2022-02-26 14:48:35');
